import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import Navbar from './Navbar';
import '../styles/auth.css';

const Signup = () => {
  const navigate = useNavigate();
  const [formData, setFormData] = useState({
    username: '',
    email: '',
    password: '',
    confirmPassword: '',
    phone: '',
    birth: '',
    gender: 'M',
    address: '',
    profileImage: null,
  });

  const handleChange = (e) => {
    if (e.target.name === 'profileImage') {
      setFormData({ ...formData, profileImage: e.target.files[0] });
    } else {
      setFormData({ ...formData, [e.target.name]: e.target.value });
    }
  };

  const handleSubmit = async (e) => {
    e.preventDefault();

    if (formData.password !== formData.confirmPassword) {
      alert('비밀번호가 일치하지 않습니다.');
      return;
    }

    const data = new FormData();
    data.append(
      'memberDTO',
      JSON.stringify({
        username: formData.username,
        email: formData.email,
        password: formData.password,
        phone: formData.phone,
        birth: formData.birth,
        gender: formData.gender,
        address: formData.address,
      })
    );

    if (formData.profileImage) {
      data.append('authImgFile', formData.profileImage);
    }

    const response = await fetch('https://sequence.agong.store/api/users/join', {
      method: 'POST',
      body: data,
    });

    const result = await response.json();
    alert(result.message);
    if (result.code === 200) navigate('/login');
  };

  return (
    <div>
      <Navbar />
      <section className="signup-container">
        <h1>회원가입</h1>
        <p>1/2</p>

        <form onSubmit={handleSubmit} className="signup-form">
          {/* 기본 정보 */}
          <div className="form-section">
            <h2>기본 정보</h2>
            <div className="form-group">
              <label>이름</label>
              <input type="text" name="name" placeholder="이름을 입력하세요." onChange={handleChange} />
            </div>

            <div className="form-group">
              <label>생년월일</label>
              <input type="date" name="birth" onChange={handleChange} />
            </div>

            <div className="form-group">
              <label>성별</label>
              <select name="gender" onChange={handleChange}>
                <option value="M">남성</option>
                <option value="F">여성</option>
              </select>
            </div>

            <div className="form-group">
              <label>휴대전화 번호</label>
              <input type="text" name="phone" placeholder="010-1234-5678" onChange={handleChange} />
            </div>

            <div className="form-group">
              <label>이메일</label>
              <input type="email" name="email" placeholder="이메일을 입력하세요." onChange={handleChange} />
            </div>

            <div className="form-group">
              <label>주소</label>
              <input type="text" name="address" placeholder="주소를 입력하세요." onChange={handleChange} />
            </div>
          </div>

          {/* 로그인 정보 */}
          <div className="form-section">
            <h2>로그인 정보</h2>
            <div className="form-group">
              <label>아이디</label>
              <input type="text" name="username" placeholder="아이디를 입력하세요." onChange={handleChange} />
            </div>

            <div className="form-group">
              <label>비밀번호</label>
              <input type="password" name="password" placeholder="비밀번호를 입력하세요." onChange={handleChange} />
            </div>

            <div className="form-group">
              <label>비밀번호 확인</label>
              <input type="password" name="confirmPassword" placeholder="비밀번호를 다시 입력하세요." onChange={handleChange} />
            </div>
          </div>

          {/* 제출 버튼 */}
          <button type="submit" className="signup-button">다음</button>
        </form>
      </section>
    </div>
  );
};

export default Signup;
